/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `order_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `encounter_id` bigint(20) NOT NULL,
  `consultation_id` bigint(20) NOT NULL,
  `user_id` bigint(20) NOT NULL,
  `product_code` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `order_quantity_request` int(11) NOT NULL,
  `order_description` text COLLATE utf8_unicode_ci,
  `order_completed` tinyint(1) DEFAULT '0',
  `updated_by` int(20) DEFAULT NULL,
  `order_quantity_supply` int(11) DEFAULT NULL,
  `store_code` varchar(20) COLLATE utf8_unicode_ci DEFAULT 'main',
  `location_code` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `order_unit_price` decimal(16,2) NOT NULL,
  `order_sale_price` double DEFAULT NULL,
  `order_total` double DEFAULT NULL,
  `order_discount` int(11) DEFAULT NULL,
  `order_is_discharge` tinyint(1) DEFAULT '0',
  `order_report` text COLLATE utf8_unicode_ci,
  `order_gst_unit` decimal(16,2) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `post_id` bigint(20) NOT NULL,
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

