/* Function  structure for function  `getIdentification` */

/*!50003 DROP FUNCTION IF EXISTS `getIdentification` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getIdentification`(`v1` VARCHAR(50), `v2` VARCHAR(50), `v3` VARCHAR(50), `v4` VARCHAR(50)) RETURNS varchar(255) CHARSET latin1
BEGIN
		DECLARE value varchar(255);
		IF v2 <>'' THEN
				SET value = v2;
		ELSEIF v1 <> '' THEN
				SET value = v1;
		END IF;
		RETURN value;
END */$$
DELIMITER ;

